import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awShowObjectHeaderRenderFunction } from 'js/AwShowObjectHeaderService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwShowObjectHeaderService', () => import('js/AwShowObjectHeaderService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awShowObjectHeaderRenderFunction",
            "deps": "js/AwShowObjectHeaderService"
        },
        "onUnmount": {
            "actionType": "JSFunction",
            "method": "onUnmount",
            "inputData": {
                "data": "{{data._eventBusSubDefs}}"
            },
            "deps": "js/AwShowObjectHeaderService"
        },
        "initialize": {
            "actionType": "JSFunctionAsync",
            "method": "initialize",
            "inputData": {},
            "deps": "js/AwShowObjectHeaderService",
            "outputData": {
                "backBtnTitle": "backButtonTitle",
                "contributedHeaderViews": "contributedHeaderViews"
            }
        },
        "getHeaderProps": {
            "actionType": "JSFunction",
            "method": "getHeaderProps",
            "inputData": {
                "headerPropsData": "{{props.headerProps}}",
                "headerData": "{{props.headerData}}"
            },
            "deps": "js/AwShowObjectHeaderService",
            "outputData": {
                "headerProps": ""
            }
        }
    },
    "data": {
        "backBtnTitle": "",
        "selection": null,
        "_activeTab": null,
        "_eventBusSubDefs": []
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onMount": "initialize",
        "onUnmount": "onUnmount",
        "onUpdate": {
            "action": "getHeaderProps",
            "observers": [
                "props.headerData"
            ]
        }
    },
    "props": {
        "headervmo": {
            "type": "viewModelObject"
        },
        "header-data": {
            "type": "object"
        },
        "header-props": {
            "type": "object"
        },
        "sub-panel-context": {
            "type": "object"
        }
    },
    "_viewModelId": "AwShowObjectHeader",
    "_uniqueViewModelId": "AwShowObjectHeader"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awShowObjectHeaderRenderFunction, undefined, ctxImportObj );

export default Component;
